(24, 1, 'product', '{\"name\":\"Folding Shock-absorbing Mechanical Walking Machine, Two Armrest Method\",\"slug\":\"nyx-beauty-couton-pallete-makeup-12\",\"slug_id\":\"64\",\"is_slug_editable\":\"1\",\"model\":\"Botble\\\\Ecommerce\\\\Models\\\\Product\",\"description\":\"<p style=\\\"text-align:center;\\\"><span style=\\\"font-family:Arial;font-size:14pt;\\\"><strong>Folding Shock-absorbing Mechanical Walking Machine, Two Armrest Methods<\\/strong><\\/span><\\/p><p><span style=\\\"background-color:#FFFF00;\\\"><span>Non-motorized treadmill, no power, mechanical walking machine<\\/span><\\/span><\\/p><p><span style=\\\"font-family:Arial;font-size:12pt;\\\"><strong>Description:<\\/strong><\\/span><\\/p><ul><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Multifunctional mechanical treadmill: walking, running, waist twisting, sit-ups, massage and other functions.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Cast steel resistance wheel design and retarder device design can provide more uniform resistance and smoother movement.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Running device (non-running belt), patented running device design, free hands, you can run without hands, belt protection, soft sponge, comfortable spring, free running, more relaxed exercise.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Easy to install, suitable for all ages, feel free to use.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Adjust the secondary slope and train different slopes for different intensities.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">High-precision running belt.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">LED display: display time\\/distance\\/speed\\/calorie consumption.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Fold immediately to save space and move lightly, especially for home use.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Sit-ups-massage wheel: Sit-ups are thickened with high-quality foam, and the massage wheel in the middle has been innovatively designed. After exercising, you can use the massage wheel to r elax the leg muscles.<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Armrests: equipped with a pair of straight armrests and a pair of curved armrests. The total height of the curved handrail is 20 cm, and the total height of the curved walking machine itself is 120 cm, suitable for adults. height<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">The height of the straight hand and the height of the walking machine is 103 cm, suitable for young people. Two armrests, suitable for the whole family.<\\/span><\\/li><\\/ul><p><span style=\\\"font-family:Arial;font-size:12pt;\\\"><strong>Features:<\\/strong><\\/span><\\/p><ul><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Belt size: 92 x 33 cm \\/ 36.2 x 12.9 inches<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Gross weight: 18 kg\\/39.7 lbs<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Packing size: 108 x 58.5 x 17 cm \\/ 42.5 x 23 x 6.7 inches<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Driving force: mechanical<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">Maximum load: 150 kg \\/ 330 lb<\\/span><\\/li><\\/ul><p><span style=\\\"font-family:Arial;font-size:12pt;\\\"><strong>Include:<\\/strong><\\/span><\\/p><ul><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">1x mechanical walking machine<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">1x English musical instrument (not including battery)<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">1x English manual<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">2x Straight armrests<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">2x Curved armrests<\\/span><\\/li><\\/ul><p><span style=\\\"background-color:#FFFF00;\\\"><span>Due to the color setting of the photo computer display or other reasons, the color may sometimes be slightly different from the photo. (All are subject to the actual received goods)<\\/span><\\/span><\\/p><p><span style=\\\"background-color:#FFFF00;\\\"><span>Since it is a manual measurement, please allow some deviation in the data. (All are subject to the actual received goods)<\\/span><\\/span><\\/p><p>&nbsp;<\\/p><ul><li style=\\\"color:#000000;\\\">&nbsp;<\\/li><\\/ul><p>&nbsp;<\\/p><div style=\\\"color:#000000;\\\"><p><span style=\\\"font-family:Arial;font-size:14pt;\\\"><strong>Note:<\\/strong><\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUESTION<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">: why doesn\'t the treadmill work? Where is the power switch?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">: the mechanical treadmill does not have motor drive, so it needs the strength of legs and feet to drive the running belt.<\\/span><\\/p><p class=\\\"MsoNormal\\\">&nbsp;<\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUESTION<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">: how<\\/span>&nbsp;<span style=\\\"font-family:Arial;font-size:11pt;\\\"> &nbsp;to<\\/span>&nbsp;<span style=\\\"font-family:Arial;font-size:11pt;\\\"> &nbsp;work?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">: first of all, hold the handrail with both hands. At the beginning of the exercise, you need to push back with your legs to drive the running belt. With inertia, the resistance will decrease, and the speed is up to you. If you stop running, the treadmill will stop with you.<\\/span>&nbsp;<span style=\\\"font-family:Arial;font-size:11pt;\\\"> &nbsp;The<\\/span><span style=\\\"font-family:Arial;\\\">&nbsp;<\\/span><span style=\\\"font-family:Arial;font-size:11pt;\\\"> &nbsp;first time you use it, there is a process of adaptation and habit (just like riding a bicycle, there is also a process of adaptation). The product will shake during exercise, please don<\\/span><span style=\\\"font-family:Arial;\\\"> <\\/span><span style=\\\"font-family:Arial;font-size:11pt;\\\">\\u2019t worry, It may be the cause of running too fast. It can be solved by tightening the running belt or increasing the slope appropriately.<\\/span><span style=\\\"font-family:\'\\u5b8b\\u4f53\';font-size:11pt;\\\">&nbsp;<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">&nbsp;<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUEATION<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">\\uff1a<\\/span><span style=\\\"font-family:\'\\u5b8b\\u4f53\';font-size:11pt;\\\">&nbsp;<\\/span><span style=\\\"font-family:Arial;font-size:11pt;\\\"> Running belt is too tight, can not run or too loose, how to adjust?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">:<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">A. adjust the running board slope.<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">B. adjust the running belt. If the running belt is too tight, please use the inner hexagon for the rear end hole of both sides to turn clockwise 1-2 times; If the running belt is too loose, please use the inner hexagon for the rear end hole on both sides to turn counter-clockwise 1-2 times.<\\/span><\\/p><p class=\\\"MsoNormal\\\">&nbsp;<\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUESTION<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">: how to adjust the running belt deviation?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span><strong> <\\/strong><span style=\\\"font-family:Arial;font-size:11pt;\\\">: The deviation of the running belt is caused by the difference in height and weight of each person. The running belt of the product is adjusted by special personnel when it leaves the factory. They are different from your height and weight, so it is possible for you to run for the first time. It will be biased, as long as it is adjusted according to the method we provide, it will not be biased.<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">1.Deviation towards the left<\\/span><br><span style=\\\"font-family:Arial;font-size:11pt;\\\">If the running belt deviates towards the left, Rotate clockwise the left bolt 1-2 laps, and then rotatecounterclockwise the right one 1-2laps,And finally run for a period of time on the running belt to judge whether it is in the middle position. If not, repeat the above action until it is in the middle. (If the running belt deviates towards the left, adjust clockwise the left screw, or adjust counterclockwise the right one)<\\/span><br><span style=\\\"font-family:Arial;font-size:11pt;\\\">------Deviation towards the right (reverse operation above)<\\/span><br><span style=\\\"font-family:Arial;font-size:11pt;\\\">2.Too tight or loose<\\/span><br><span s