tyle=\\\"font-family:Arial;font-size:11pt;\\\">2x Straight armrests<\\/span><\\/li><li><span style=\\\"font-family:Arial;font-size:11pt;\\\">2x Curved armrests<\\/span><\\/li><\\/ul><p><span style=\\\"background-color:#FFFF00;\\\"><span>Due to the color setting of the photo computer display or other reasons, the color may sometimes be slightly different from the photo. (All are subject to the actual received goods)&nbsp;<\\/span><\\/span><\\/p><p><span style=\\\"background-color:#FFFF00;\\\"><span>Since it is a manual measurement, please allow some deviation in the data. (All are subject to the actual received goods)&nbsp;<\\/span><\\/span><\\/p><p>&nbsp;<\\/p><ul><li style=\\\"color:#000000;\\\">&nbsp;<\\/li><\\/ul><p>&nbsp;<\\/p><div style=\\\"color:#000000;\\\"><p><span style=\\\"font-family:Arial;font-size:14pt;\\\"><strong>Note:<\\/strong><\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUESTION<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">: why doesn\'t the treadmill work? Where is the power switch?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">: the mechanical treadmill does not have motor drive, so it needs the strength of legs and feet to drive the running belt.<\\/span><\\/p><p class=\\\"MsoNormal\\\">&nbsp;<\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUESTION<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">: how<\\/span> &nbsp;<span style=\\\"font-family:Arial;font-size:11pt;\\\"> &nbsp;to<\\/span> &nbsp;<span style=\\\"font-family:Arial;font-size:11pt;\\\"> &nbsp;work?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">: first of all, hold the handrail with both hands. At the beginning of the exercise, you need to push back with your legs to drive the running belt. With inertia, the resistance will decrease, and the speed is up to you. If you stop running, the treadmill will stop with you.<\\/span> &nbsp;<span style=\\\"font-family:Arial;font-size:11pt;\\\"> &nbsp;The<\\/span>&nbsp;<span style=\\\"font-family:Arial;\\\">&nbsp;<\\/span>&nbsp;<span style=\\\"font-family:Arial;font-size:11pt;\\\"> first time you use it, there is a process of adaptation and habit (just like riding a bicycle, there is also a process of adaptation). The product will shake during exercise, please don<\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">\\u2019t worry, It may be the cause of running too fast. It can be solved by tightening the running belt or increasing the slope appropriately.<\\/span>&nbsp;<span style=\\\"font-family:\'\\u5b8b\\u4f53\';font-size:11pt;\\\">&nbsp;<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">&nbsp;<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUEATION<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">\\uff1a<\\/span>&nbsp;<span style=\\\"font-family:\'\\u5b8b\\u4f53\';font-size:11pt;\\\">&nbsp;<\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">Running belt is too tight, can not run or too loose, how to adjust?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">:<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">A. adjust the running board slope.<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">B. adjust the running belt. If the running belt is too tight, please use the inner hexagon for the rear end hole of both sides to turn clockwise 1-2 times; If the running belt is too loose, please use the inner hexagon for the rear end hole on both sides to turn counter-clockwise 1-2 times.<\\/span><\\/p><p class=\\\"MsoNormal\\\">&nbsp;<\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>QUESTION<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">: how to adjust the running belt deviation?<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\"><strong>ANSWER<\\/strong><\\/span> <span style=\\\"font-family:Arial;font-size:11pt;\\\">: The deviation of the running belt is caused by the difference in height and weight of each person. The running belt of the product is adjusted by special personnel when it leaves the factory. They are different from your height and weight, so it is possible for you to run for the first time. It will be biased, as long as it is adjusted according to the method we provide, it will not be biased.<\\/span><\\/p><p class=\\\"MsoNormal\\\"><span style=\\\"font-family:Arial;font-size:11pt;\\\">1.Deviation towards the left<\\/span>&nbsp;<br><span style=\\\"font-family:Arial;font-size:11pt;\\\">If the running belt deviates towards the left, Rotate clockwise the left bolt 1-2 laps, and then rotatecounterclockwise the right one 1-2laps,And finally run for a period of time on the running belt to judge whether it is in the middle position. If not, repeat the above action until it is in the middle. (If the running belt deviates towards the left, adjust clockwise the left screw, or adjust counterclockwise the right one)<\\/span>&nbsp;<br><span style=\\\"font-family:Arial;font-size:11pt;\\\">------Deviation towards the right (reverse operation above)<\\/span>&nbsp;<br><span style=\\\"font-family:Arial;font-size:11pt;\\\">2.Too tight or loose<\\/span>&nbsp;<br><span style=\\\"font-family:Arial;font-size:11pt;\\\">If the running belt is too tight, it will cause damage 