INSERT INTO `ec_reviews` (`id`, `customer_id`, `product_id`, `star`, `comment`, `status`, `created_at`, `updated_at`, `images`) VALUES
(1, 6, 16, 5.00, 'The script is the best of its class, fast, easy to implement and work with , and the most important thing is the great support team , Recommend with no doubt.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/1.jpg\",\"products\\/6.jpg\"]'),
(2, 10, 19, 1.00, 'It\'s not my first experience here on Codecanyon and I can honestly tell you all that Botble puts a LOT of effort into the support. They answer so fast, they helped me tons of times. REALLY by far THE BEST EXPERIENCE on Codecanyon. Those guys at Botble are so good that they deserve 5 stars. I recommend them, I trust them and I can\'t wait to see what they will sell in a near future. Thank you Botble :)', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/3.jpg\",\"products\\/6.jpg\",\"products\\/11.jpg\"]'),
(3, 3, 11, 4.00, 'Very enthusiastic support! Excellent code is written. It\'s a true pleasure working with.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/4.jpg\",\"products\\/7.jpg\"]'),
(4, 6, 3, 4.00, 'Customer Support are grade (A*), however the code is a way too over engineered for it\'s purpose.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/4.jpg\",\"products\\/5.jpg\"]'),
(5, 6, 15, 3.00, 'For me the best eCommerce script on Envato at this moment: modern, clean code, a lot of great features. The customer support is great too: I always get an answer within hours!', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/2.jpg\"]'),
(6, 2, 11, 3.00, 'Perfect +++++++++ i love it really also i get to fast ticket answers... Thanks Lot BOTBLE Teams', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/2.jpg\",\"products\\/7.jpg\"]'),
(7, 7, 10, 2.00, 'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/1.jpg\",\"products\\/5.jpg\"]'),
(8, 6, 11, 2.00, 'Very enthusiastic support! Excellent code is written. It\'s a true pleasure working with.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/4.jpg\",\"products\\/7.jpg\"]'),
(9, 6, 23, 4.00, 'Cool template. Excellent code quality. The support responds very quickly, which is very rare on themeforest and codecanyon.net, I buy a lot of templates, and everyone will have a response from technical support for two or three days. Thanks to tech support. I recommend to buy.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/3.jpg\",\"products\\/5.jpg\",\"products\\/16.jpg\"]'),
(10, 7, 17, 4.00, 'The script is the best of its class, fast, easy to implement and work with , and the most important thing is the great support team , Recommend with no doubt.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/2.jpg\"]'),
(12, 2, 17, 3.00, 'Clean & perfect source code', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/3.jpg\",\"products\\/13.jpg\"]'),
(13, 6, 2, 4.00, 'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/3.jpg\",\"products\\/21.jpg\"]'),
(14, 6, 8, 2.00, 'Good app, good backup service and support. Good documentation.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/1.jpg\",\"products\\/5.jpg\"]'),
(15, 1, 1, 5.00, 'Great system, great support, good job Botble. I\'m looking forward to more great functional plugins.', 'published', '2022-07-25 08:36:08', '2022-07-25 08:36:08', '[\"products\\/2.jpg\",\"products\\/6.jpg\",\"products\\/19.jpg\"]'),
